INSERT INTO IMAGE (img_description, img_image) SELECT 'Aladdin', '' from dual where not exists (select 1 from IMAGE where img_description = 'Aladdin');
INSERT INTO OBJET_A_COLLECTIONNER (oac_code, oac_rarete, oac_img_id) SELECT 'Aladdin', 'C', 1 from dual where not exists (select 1 from OBJET_A_COLLECTIONNER where oac_code = 'Aladdin');